import React from 'react'
import { Link } from 'react-router-dom'
import StartNow from '../views/StarNow'

const Registro = () => {
  return (
    <>
    
    {/*about-part start*/}
    <section className="about-part project-part">
      <div className="container">
        <div className="about-part-details text-center">
        <h2>Â¿Quieres iniciar un nuevo proyecto con nosotros? Registrate!</h2>
          <div className="about-part-content">
            <div className="breadcrumbs">
              <div className="container">
                <ol className="breadcrumb">
                  <li>
                    <Link to="/">home</Link>
                    <span>//</span>
                  </li>
                  <li>
                    <Link to="/project">Proyecto</Link>
                  </li>
                </ol>
                {/*/.breadcrumb*/}
              </div>
              {/*/.container*/}
            </div>
            {/*/.breadcrumbs*/}
          </div>
          {/*/.about-part-content*/}
        </div>
        {/*/.about-part-details*/}
      </div>
      {/*/.container*/}
    </section>
    {/*/.about-part*/}
    {/*about-part end*/}
    <StartNow />
  </>
  )
}

export default Registro
